  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0115322 includes time series
  data collected from MOORINGS in the North Pacific Ocean and Olympic Coast National
  Marine Sanctuary from 2006-06-23 to 2013-09-05. These data include AIR-SEA DIFFERENCE
  - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT SATURATION,
  Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure
  (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The
  instruments used to collect these data include Bubble type equilibrator for autonomous
  carbon dioxide (CO2) measurement, Carbon dioxide (CO2) gas analyzer, Humidity Sensor,
  oxygen meter and thermosalinographs.nnThese data were collected by Adrienne Sutton,
  Christopher Sabine, Stacy Maenner and Sylvia Musielewicz of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory as part of the Mooring_WA_125W_47N_Aug2012_Sep2013,
  Mooring_WA_125W_47N_Jun2006_May2007, Mooring_WA_125W_47N_Jun2010_Sep2011, Mooring_WA_125W_47N_May2007_Sep2007,
  Mooring_WA_125W_47N_May2009_Jun2010, Mooring_WA_125W_47N_Oct2007_May2009 and Mooring_WA_125W_47N_Sep2011_Nov2011
  data set. CDIAC assigned the following cruise ID(s) to this data set: WA20090529,
  WA20100624, WA20110902, WA20120809, WACE20060623, WA__20070519 and WA__20071017.nnThe
  Global CO2 Time-series and Moorings Project involves international groups from 18
  countries who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\":
